// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

contract EventDriverArchitecture{

    event TransferInitiated(address indexed from, address indexed to, uint value, bytes32 transferId);

    event TransferConfirmed(address indexed from, address indexed to, uint value);

    struct Transfer{
        address from;
        address to;
        uint value;
        bool exist;
    }

    mapping(bytes32=>Transfer) public initiatedTransfer;

    struct TransferConfirmation{
        bool confirmed;
        uint confirmedAt;
        address confirmedBy;
    }

    mapping(bytes32=> TransferConfirmation) public TransferConfirmations;

    function initiateTransfer(address to,uint value) public{
        require(to != address(0),"Invalid receipt address");
        require(value > 0,"Transfer value must be greater than 0");

        bytes32 transferId = keccak256(abi.encodePacked(msg.sender,to,value,block.timestamp));

        require(initiatedTransfer[transferId].from == address(0),"Transfer already initiated");

        initiatedTransfer[transferId] = Transfer({
            from: msg.sender,
            to: to,
            value: value,
            exist: true
        });

        emit TransferInitiated(msg.sender, to, value, transferId);
    }

    function confirmTransfer(bytes32 transferId) public {
        require(initiatedTransfer[transferId].from != address(0),"transfer not initiated.");
        require(!TransferConfirmations[transferId].confirmed,"trasnfer already confirmed!");
    }
}

